ears.","noQuestions":false,"characteristics" => {"LK":["CTDG"],"TL":["BSH"],"BLD":["STCK","LNK"],"CLR":["TNLLW","BRWN","BLCK"],"HRNS":[],"PTTRN":["SPTS"]},"confusionsOrder":["WLDDG"]},"HR" => {"image":[],"label" => "T1.choices.HR.label","images":["hare-1.jpg","hare-2.jpg","hare-3.jpg"],"confusions" => {},"description" => "Large rabbitlike animal with very long ears. There are two hare species in Gorongosa. The savanna hare has gray fur with a lighter brown underbelly, while the scrub hare is darker gray and has a white underbelly.","noQuestions":false,"characteristics" => {"LK":["THR"],"TL":["BSH","SHRT"],"BLD":["SMLL","LWSLNG"],"CLR":["TNLLW","BRWN","WHT","GR"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":[]},"KD" => {"image":[],"label" => "T1.choices.KD.label","images":["kudu-1.jpg","kudu-2.jpg","kudu-3.jpg"],"confusions" => {"NL" => "A nyala is smaller than a kudu and females are more reddish-brown while males are chestnut with orange legs.","LND" => "An eland is more stocky and ox-like than a kudu with long, straight horns that twist. It has a dewlap below the neck.","HRTBST" => "A hartebeest is more slender than a kudu with reddish fur, narrow face, and short, spiral horns."},"description" => "Large, lanky antelope with long legs, a short mane along the neck and shoulders, a brownish-gray to tan coat with vertical white stripes along the torso, a white chevron between the eyes, and large round ears. Males have a beard along the throat and massive spiral horns. Females are have no horns","noQuestions":false,"characteristics" => {"LK":["CWHRS","NTLPDR"],"TL":["BSH","SHRT"],"BLD":["STCK","LNK","LRG"],"CLR":["TNLLW","RD","BRWN","WHT","GR"],"HRNS":["CRVD","SPRL"],"PTTRN":["SLD","STRPS"]},"confusionsOrder":["LND","HRTBST","NL"]},"NL" => {"image":[],"label" => "T1.choices.NL.label","images":["nyala-1.jpg","nyala-2.jpg","nyala-3.jpg"],"confusions" => {"KD" => "A kudu is larger than a nyala with grayish-tan fur. Males have shaggy beards and massive, spiral horns."},"description" => "Medium-sized antelope with long legs and a shaggy tail. Males are dark brown to reddish with thin white stripes and small spots on the rump, orange legs and a white patch of fur between the eyes. Males also have a mane along the neck, chest, and belly as well as long, spiraling horns. Females are tan with vertical white stripes and spots on the sides, large ears, and no horns.","noQuestions":false,"characteristics" => {"LK":["NTLPDR"],"TL":["BSH","SHRT"],"BLD":["STCK","LNK","LRG"],"CLR":["RD","BRWN","WHT","GR"],"HRNS":["CRVD","SPRL"],"PTTRN":["SLD","STRPS","SPTS"]},"confusionsOrder":["KD"]},"RB" => {"image":[],"label" => "T1.choices.RB.label","images":["oribi-1.jpg","oribi-2.jpg","oribi-3.jpg"],"confusions" => {"DKR" => "A duiker is stockier than an oribi with a rounded back. The common duiker has a dark stripe on it's nose, while the red duiker has reddish fur and the blue duiker has bluish-gray fur."},"description" => "Small, deerlike antelope with a long, slender neck, brownish fur with a white underbelly, white around the eyes and muzzle, and distinctive black spots below the ears. Males have short, straight horns, while females have no horns.","noQuestions":false,"characteristics" => {"LK":["NTLPDR"],"TL":["BSH","SHRT"],"BLD":["LNK","SMLL"],"CLR":["TNLLW","RD","BRWN","WHT"],"HRNS":["STRGHT"],"PTTRN":["SLD","BNDS"]},"confusionsOrder":["DKR"]},"BBN" => {"image":[],"label" => "T1.choices.BBN.label","images":["baboon-1.jpg","baboon-2.jpg","baboon-3.jpg"],"confusions" => {"SMNGMNK" => "A samango monkey has bluish-gray fur while a baboon has yellow-brown fur. It also has a dark face with prominent fur on the cheeks.","VRVTMNK" => "A vervet monkey is much smaller than a baboon with a black face and light gray fur."},"description" => "Medium-sized primate with golden fur that is paler on the underbelly and a dark face that protrudes and widens at the nose and mouth. It has a straight brow, brown eyes, and a tail that juts out and drops.","noQuestions":false,"characteristics" => {"LK":["CTDG","PRMT","THR"],"TL":["SMTH","LNG"],"BLD":["LNK","SMLL"],"CLR":["TNLLW","BRWN","GR"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":["SMNGMNK","VRVTMNK"]},"CRN" => {"image":[],"label" => "T1.choices.CRN.label","images":["crane-1.jpg","crane-2.jpg","crane-3.jpg"],"confusions" => {},"description" => "Long-legged, long-necked bird with a straight beak. There are two crane species in Gorongosa: the grey crowned crane and the wattled crane. The gray-crowned crane has gray, white, and yellow feathers with a distinctive yellow fan of feathers on its head. The wattled crane has gray, black, and white feathers with red skin around its yellow beak.","noQuestions":false,"characteristics" => {"LK":["BRD"],"TL":["SMTH","LNG"],"BLD":["LNK"],"CLR":["TNLLW","WHT","GR","BLCK"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":[]},"CVT" => {"image":[],"label" => "T1.choices.CVT.label","images":["civet-1.jpg","civet-2.jpg","civet-3.jpg"],"confusions" => {"GNT" => "A genet is more slender than a civet with a much longer, bushier tail."},"description" => "Long, stocky mammal with short legs and a pointy face. Fur is light brown-gray with a dark mask, white at the tip of the muzzle, dark legs, spots, and bands along the neck.","noQuestions":false,"characteristics" => {"LK":["CTDG","WSL"],"TL":["SMTH","BSH","LNG","SHRT"],"BLD":["SMLL","LWSLNG"],"CLR":["TNLLW","BRWN","WHT","GR","BLCK"],"HRNS":[],"PTTRN":["STRPS","BNDS","SPTS"]},"confusionsOrder":["GNT"]},"DKR" => {"image":[],"label" => "T1.choices.DKR.label","images":["duiker-1.jpg","duiker-2.jpg","duiker-3.jpg"],"confusions" => {"RB" => "An oribi is more slender and taller than a duiker with a flat back, white underbelly, and prominent black spots below the ears."},"description" => "Duikers are small, deerlike antelope with a thin, short tail and colors ranging from blue-gray to red depending on the species. Males have short, straight horns. There are three species of duiker in Gorongosa: red, common, and blue duiker.","noQuestions":false,"characteristics" => {"LK":["NTLPDR"],"TL":["BSH","SHRT"],"BLD":["LNK","SMLL"],"CLR":["TNLLW","RD","BRWN","GR"],"HRNS":["STRGHT"],"PTTRN":["SLD"]},"confusionsOrder":["RB"]},"GNT" => {"image":[],"label" => "T1.choices.GNT.label","images":["genet-1.jpg","genet-2.jpg","genet-3.jpg"],"confusions" => {"CVT" => "A civet is stockier than a genet with a much shorter tail and a dark mask on the face."},"description" => "Small, slender animal with tan-gray fur, large, ringed spots, a long, thick, black-ringed tail, and a white underbelly. It has a black stripe down the spine and a pointy muzzle.","noQuestions":false,"characteristics" => {"LK":["CTDG","WSL"],"TL":["SMTH","BSH","LNG"],"BLD":["SMLL","LWSLNG"],"CLR":["BRWN","GR","BLCK"],"HRNS":[],"PTTRN":["STRPS","BNDS","SPTS"]},"confusionsOrder":["CVT"]},"HMN" => {"image":[],"label" => "T1.choices.HMN.label","images":["human-1.jpg","human-2.jpg","human-3.jpg"],"confusions" => {},"description" => "Sometimes people are captured in photos too, such as researchers checking the cameras, scouts on patrol, and tourists driving past in their vehicles.","noQuestions":false,"characteristics" => {"LK":["PRMT","THR"],"TL":[],"BLD":["STCK","LNK","LRG","SMLL"],"CLR":["TNLLW","RD","BRWN","WHT","GR","BLCK"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":[]},"LND" => {"image":[],"label" => "T1.choices.LND.label","images":["eland-1.jpg","eland-2.jpg","eland-3.jpg"],"confusions" => {"KD" => "A kudu is taller and less ox-like than an eland, it has massive spiral horns and lacks a dewlap on the throat.","HRTBST" => "A hartebeest is a taller and more slender than an eland with reddish fur, narrow face, and short, spiral horns."},"description" => "Massive antelope with an oxlike body and short legs. Both sexes have straight, spiraled horns, a short mane, and a smooth light tan to gray coat with thin white stripes on the sides. Males have a large dewlap under the throat.","noQuestions":false,"characteristics" => {"LK":["CWHRS","NTLPDR"],"TL":["TFTD","LNG"],"BLD":["STCK","LRG"],"CLR":["TNLLW","RD","BRWN","WHT","GR"],"HRNS":["STRGHT","SPRL"],"PTTRN":["SLD","STRPS"]},"confusionsOrder":["HRTBST","KD"]},"MPL" => {"image":[],"label" => "T1.choices.MPL.label","images":["impala-1.jpg","impala-2.jpg","impala-3.jpg"],"confusions" => {"RDBCK" => "A reedbuck has solid tan fur without horizontal bands. Its horns are curved and ringed and it has large, black spots below the ears.","BSHBCK" => "A bushbuck has vertical white stripes and spots on the flanks as well as a rounded back."},"description" => "Medium-sized antelope with reddish-brown fur, white stripes around the eyes, and black stripes on the forehead and tail. Coat forms horizontal bands of red fur along the back, tan fur along the sides, and white fur on the underbelly. Males have large horns.","noQuestions":false,"characteristics" => {"LK":["NTLPDR"],"TL":["BSH","SHRT"],"BLD":["LNK","LRG"],"CLR":["TNLLW","RD","BRWN","WHT","BLCK"],"HRNS":["STRGHT","CRVD","SPRL"],"PTTRN":["SLD","BNDS"]},"confusionsOrder":["BSHBCK","RDBCK"]},"TTR" => {"image":[],"label" => "T1.choices.TTR.label","images":["otter-1.jpg","otter-2.jpg","otter-3.jpg"],"confusions" => {"WSL" => "The weasel species in Gorongosa are skunklike with black and white fur.","MNGS" => "A mongoose is smaller and more slender than an otter, with a long thin tail.","HNBDGR" => "A honey badger has a distinct white patch on its back and is stockier than an otter"},"description" => "Small, sleek mammal with a long body, short legs, and brown-gray fur. Otters have webbed feet, small, round ears, and a thick tail. There are two otter species in Gorongosa. The Cape clawless otter is lighter brown has a pale underbelly, while the spotted-necked otter is smaller and has darker fur with white spots on the neck.","noQuestions":false,"characteristics" => {"LK":[],"TL":[],"BLD":[],"CLR":[],"HRNS":[],"PTTRN":[]},"confusionsOrder":["HNBDGR","MNGS","WSL"]},"WSL" => {"image":[],"label" => "T1.choices.WSL.label","images":["weasel-1.jpg","weasel-2.jpg"],"confusions" => {"MNGS" => "The mongoose species in Gorongosa are various shades of brown while the weasels are black and white and skunklike."},"description" => "The two weasel species in Gorongosa are the zorilla and the African striped weasel. Both are skunklike with black fur, large white stripes along the back, and a fluffy tail. Zorillas are fluffier with three white patches on the face, while African striped weasels are smoother with a black face.","noQuestions":false,"characteristics" => {"LK":["WSL"],"TL":["SMTH","LNG"],"BLD":["SMLL","LWSLNG"],"CLR":["RD","BRWN","GR"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":["MNGS"]},"ZBR" => {"image":[],"label" => "T1.choices.ZBR.label","images":["zebra-1.jpg","zebra-2.jpg","zebra-3.jpg"],"confusions" => {},"description" => "Horselike animal with short, white fur and distinctive black stripes. The mane is striped and sticks up vertically along the neck. The muzzle, nose, and tufted tail are black.","noQuestions":false,"characteristics" => {"LK":["CWHRS"],"TL":["TFTD","LNG"],"BLD":["STCK","LRG"],"CLR":["WHT","BLCK"],"HRNS":[],"PTTRN":["STRPS"]},"confusionsOrder":[]},"BFFL" => {"image":[],"label" => "T1.choices.BFFL.label","images":["buffalo-1.jpg","buffalo-2.jpg","buffalo-3.jpg"],"confusions" => {"WLDBST" => "A wildebeest is more slender than a buffalo with a long, narrow face and a beard."},"description" => "Large, cattlelike animal with short legs and a long, tufted tail, dark brown to black fur, large, droopy ears, and a broad muzzle. Both sexes have U-shaped horns, but males horns form a fused shield on the top of their heads.","noQuestions":false,"characteristics" => {"LK":["CWHRS"],"TL":["TFTD","LNG"],"BLD":["STCK","LRG"],"CLR":["RD","BRWN","GR","BLCK"],"HRNS":["CRVD","SHPD"],"PTTRN":["SLD"]},"confusionsOrder":["WLDBST"]},"CRCL" => {"image":[],"label" => "T1.choices.CRCL.label","images":["caracal-1.jpg","caracal-2.jpg","caracal-3.jpg"],"confusions" => {"LNFML" => "A lion is larger than a caracal with rounded ears, no white or black markings on the face or ears, and its fur is a lighter golden-yellow color."},"description" => "Medium to large muscular cat with red-brown fur, a lighter underbelly, distinctive large, pointy ears with tufts of black fur at the tips, and white and black striped markings on the face.","noQuestions":false,"characteristics" => {"LK":["CTDG"],"TL":["SMTH","LNG"],"BLD":["LNK","LRG"],"CLR":["TNLLW","RD","BRWN","WHT"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":["LNFML"]},"JCKL" => {"image":[],"label" => "T1.choices.JCKL.label","images":["jackal-1.jpg","jackal-2.jpg","jackal-3.jpg"],"confusions" => {"WLDDG" => "A wild dog is more larger than a jackal with patchy black, orange, and white fur."},"description" => "Medium-sized, gray-brown, doglike animal with a pointy face and ears. It has tan legs and underbelly with a black and white striped side, a gray back, and a long, bushy black tail with a white tip.","noQuestions":false,"characteristics" => {"LK":["CTDG"],"TL":["BSH","LNG"],"BLD":["LNK","SMLL"],"CLR":["TNLLW","RD","BRWN","WHT","GR","BLCK"],"HRNS":[],"PTTRN":["SLD","BNDS"]},"confusionsOrder":["WLDDG"]},"LNCB" => {"image":[],"label" => "T1.choices.LNCB.label","images":["lioncub-1.jpg","lioncub-2.jpg"],"confusions" => {"LPRD" => "A leopard is much larger than a lion cub and it has dark spots.","LNFML" => "A female lion is much larger than a cub."},"description" => "Cubs are smaller than adults with tan-yellow fur and some darker spots, a lighter underbelly, and white fur under the chin. Cubs do not have manes.","noQuestions":false,"characteristics" => {"LK":["CTDG"],"TL":["TFTD","LNG"],"BLD":["STCK","LNK","SMLL"],"CLR":["TNLLW","RD","BRWN"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":["LNFML","LPRD"]},"LNML" => {"image":[],"label" => "T1.choices.LNML.label","images":["lionmale-1.jpg","lionmale-2.jpg","lionmale-3.jpg"],"confusions" => {},"description" => "Large, muscular cat with short tan-yellow fur, a long, smooth tail with a tuft at the end, a lighter underbelly, and white fur under the chin. Males have a thick reddish mane that gets darker and thicker with age.","noQuestions":false,"characteristics" => {"LK":["CTDG"],"TL":["TFTD","LNG"],"BLD":["STCK","LNK","LRG"],"CLR":["TNLLW","RD","BRWN"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":[]},"LPRD" => {"image":[],"label" => "T1.choices.LPRD.label","images":["leopard-1.jpg","leopard-2.jpg","leopard-3.jpg"],"confusions" => {"LNCB" => "A lion cub is small with solid golden-tan fur without dark spots.","SRVL" => "A serval is much smaller and lankier than a leopard with pointy ears, a small face, and a bushy tail.","LNFML" => "A lion has solid golden-tan fur without dark spots."},"description" => "Large, muscular cat with short, yellow fur and black, ringed spots, small, round ears, and a long, smooth tail.","noQuestions":false,"characteristics" => {"LK":["CTDG"],"TL":["SMTH","LNG"],"BLD":["STCK","LNK","LRG"],"CLR":["TNLLW","BLCK"],"HRNS":[],"PTTRN":["SPTS"]},"confusionsOrder":["LNFML","LNCB","SRVL"]},"MNGS" => {"image":[],"label" => "T1.choices.MNGS.label","images":["mongoose-1.jpg","mongoose-2.jpg","mongoose-3.jpg"],"confusions" => {"WSL" => "The weasel species in Gorongosa are skunklike with black and white fur."},"description" => "Small, sleek mammal with short legs, a long body, and a long tail. There are eight mongoose species in Gorongosa that range in size and color from the brown dwarf mongoose to the larger Egyptian mongoose with bushy gray fur and tiny spots.","noQuestions":false,"characteristics" => {"LK":["WSL"],"TL":["SMTH","LNG"],"BLD":["SMLL","LWSLNG"],"CLR":["RD","BRWN","GR"],"HRNS":[],"PTTRN":["SLD","STRPS","BNDS"]},"confusionsOrder":["WSL"]},"RDNT" => {"image":[],"label" => "T1.choices.RDNT.label","images":["mammalother-1.jpg","mammalother-2.jpg","mammalother-3.jpg"],"confusions" => {},"description" => "Rodents include mice, rats, gerbils, and squirrels, which are all small mammals with a long tail. There are 30 known rodent species in Gorongosa. Porcupines are also rodents but they have their own separate category. If you see a rodent in an image, mark it here.","noQuestions":false,"characteristics" => {"LK":["WSL","THR"],"TL":["SMTH","BSH","TFTD","LNG","SHRT"],"BLD":["STCK","LNK","LRG","SMLL","LWSLNG"],"CLR":["TNLLW","RD","BRWN","WHT","GR","BLCK"],"HRNS":[],"PTTRN":["SLD","STRPS","BNDS","SPTS"]},"confusionsOrder":[]},"RPTL" => {"image":[],"label" => "T1.choices.RPTL.label","images":["reptile-1.jpg","reptile-2.jpg","reptile-3.jpg"],"confusions" => {},"description" => "There are over 60 species of reptiles in Gorongosa including crocodiles, snakes, lizards, chameleons, geckos, skinks, tortoises, terrapins, and turtles. This category includes any reptile that you find!","noQuestions":false,"characteristics" => {"LK":["THR"],"TL":["SMTH","LNG","SHRT"],"BLD":["STCK","LRG","LWSLNG"],"CLR":["TNLLW","RD","BRWN","WHT","GR","BLCK"],"HRNS":[],"PTTRN":["SLD","STRPS","BNDS","SPTS"]},"confusionsOrder":[]},"SRVL" => {"image":[],"label" => "T1.choices.SRVL.label","images":["serval-1.jpg","serval-2.jpg","serval-3.jpg"],"confusions" => {"LPRD" => "A leopard is much larger and stockier than a serval and it has a round face and a smooth tail.","WLDCT" => "A wildcat is smaller and stockier than a serval and resembles a house cat."},"description" => "Medium-sized cat with long legs, a long neck, a lanky body, yellow-tan fur with black spots, very large ears, a long, striped tail, and black stripes around the neck, nose, and eyes.","noQuestions":false,"characteristics" => {"LK":["CTDG"],"TL":["SMTH","BSH","LNG","SHRT"],"BLD":["LNK","SMLL"],"CLR":["TNLLW","BRWN","BLCK"],"HRNS":[],"PTTRN":["STRPS","BNDS","SPTS"]},"confusionsOrder":["LPRD","WLDCT"]},"VLTR" => {"image":[],"label" => "T1.choices.VLTR.label","images":["vulture-1.jpg","vulture-2.jpg","vulture-3.jpg"],"confusions" => {},"description" => "A large raptor with a bald head, large wings, and talons that is often found scavenging on carcasses. Gorongosa has five species of vultures, each with a distinct appearance. The hooded, white-headed, and lappet-faced vultures all have mostly black feathers and pink to blue faces. The white-backed and Egyptian vultures both have lighter gray to white feathers with gray and yellow faces (respectively).","noQuestions":false,"characteristics" => {"LK":["BRD"],"TL":["SMTH"],"BLD":["SMLL"],"CLR":["TNLLW","BRWN","WHT","GR","BLCK"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":[]},"BSHPG" => {"image":[],"label" => "T1.choices.BSHPG.label","images":["bushpig-1.jpg","bushpig-2.jpg","bushpig-3.jpg"],"confusions" => {"WRTHG" => "A warthog is a slate gray color with prominent warts on the sides of its face and larger tusks than a bushpig."},"description" => "Squat, flat-nosed, and piglike with long ears and reddish-brown fur with silver running down the spine. Both sexes have short, inconspicuous tusks.","noQuestions":false,"characteristics" => {"LK":["THR"],"TL":["TFTD"],"BLD":["STCK","SMLL","LWSLNG"],"CLR":["RD","BRWN"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":["WRTHG"]},"LNFML" => {"image":[],"label" => "T1.choices.LNFML.label","images":["lionfemale-1.jpg","lionfemale-2.jpg","lionfemale-3.jpg"],"confusions" => {"CRCL" => "A caracal has pointy ears, reddish-tan fur, and white and black markings on the face.","LNCB" => "A lion cub is much smaller than an adult female lion.","LPRD" => "A leopard has dark black spots."},"description" => "Large, muscular cat with short tan-yellow fur, a long, smooth tail, a lighter underbelly, and white fur under the chin. Females do not have manes.","noQuestions":false,"characteristics" => {"LK":["CTDG"],"TL":["TFTD","LNG"],"BLD":["STCK","LNK","LRG"],"CLR":["TNLLW","RD","BRWN"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":["LNCB","CRCL","LPRD"]},"LPHNT" => {"image":[],"label" => "T1.choices.LPHNT.label","images":["elephant-1.jpg","elephant-2.jpg","elephant-3.jpg"],"confusions" => {},"description" => "Huge, leathery, gray-skinned mammal with large, floppy ears and thick, strong legs. It has a short, tufted tail and a long, thick trunk. Some elephants of both sexes have large, white tusks, but some individuals never develop tusks or develop only one tusk.","noQuestions":false,"characteristics" => {"LK":["CWHRS","THR"],"TL":["TFTD"],"BLD":["STCK","LRG"],"CLR":["GR"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":[]},"PNGLN" => {"image":[],"label" => "T1.choices.PNGLN.label","images":["pangolin-1.jpg","pangolin-2.jpg","pangolin-3.jpg"],"confusions" => {"RDVRK" => "An aardvark has brown fur and a long, flat snout."},"description" => "Small, stocky animal with short legs and a long, thick tail. The pangolin is covered with hard, armored, brown scales. It has a small, pointy face and large claws.","noQuestions":false,"characteristics" => {"LK":["THR"],"TL":["SMTH","LNG"],"BLD":["STCK","SMLL","LWSLNG"],"CLR":["RD","BRWN","GR"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":["RDVRK"]},"PRCPN" => {"image":[],"label" => "T1.choices.PRCPN.label","images":["porcupine-1.jpg","porcupine-2.jpg","porcupine-3.jpg"],"confusions" => {},"description" => "Short, stocky animal with brown fur and long, black and white quills covering its back from head to tail. It has a small face with dark eyes and a blunt nose. It is often seen at night.","noQuestions":false,"characteristics" => {"LK":["THR"],"TL":["BSH","SHRT"],"BLD":["STCK","SMLL","LWSLNG"],"CLR":["BRWN","WHT","BLCK"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":[]},"RDBCK" => {"image":[],"label" => "T1.choices.RDBCK.label","images":["reedbuck-1.jpg","reedbuck-2.jpg","reedbuck-3.jpg"],"confusions" => {"MPL" => "An impala has horizontal bands and males have large, spiral horns.","BSHBCK" => "A bushbuck has vertical white stripes and spots on the flanks as well as a rounded back."},"description" => "Medium-sized, slender antelope with tan to brown fur, a white underbelly, white around the eyes and muzzle, and distinctive dark spots under their large ears. Males have ringed horns that curve forward, while females have no horns.","noQuestions":false,"characteristics" => {"LK":["NTLPDR"],"TL":["BSH","SHRT"],"BLD":["LNK","LRG"],"CLR":["TNLLW","RD","BRWN"],"HRNS":["STRGHT","CRVD"],"PTTRN":["SLD"]},"confusionsOrder":["BSHBCK","MPL"]},"RDVRK" => {"image":[],"label" => "T1.choices.RDVRK.label","images":["aardvark-1.jpg","aardvark-2.jpg","aardvark-3.jpg"],"confusions" => {"PNGLN" => "A pangolin is covered in scales while an aardvark has brown fur. It also has a shorter, pointier snout than an aardvark."},"description" => "Short, stocky animal with a long snout and a flat, piglike nose. The aardvark has brown to pink skin with thin, bristly hair, long ears, clawed toes, and a long, smooth tail.","noQuestions":false,"characteristics" => {"LK":["WSL","THR"],"TL":["SMTH","LNG"],"BLD":["STCK","SMLL"],"CLR":["RD","BRWN","GR"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":["PNGLN"]},"WLDCT" => {"image":[],"label" => "T1.choices.WLDCT.label","images":["wildcat-1.jpg","wildcat-2.jpg","wildcat-3.jpg"],"confusions" => {"SRVL" => "A serval is larger, taller, and more slender than a wildcat with yellow fur and black spots."},"description" => "Resembles a domestic tabby cat with brown to gray fur and darker stripes with a long striped tail.","noQuestions":false,"characteristics" => {"LK":["CTDG"],"TL":["SMTH","LNG"],"BLD":["LNK","SMLL"],"CLR":["TNLLW","RD","BRWN","GR","BLCK"],"HRNS":[],"PTTRN":["STRPS"]},"confusionsOrder":["SRVL"]},"WLDDG" => {"image":[],"label" => "T1.choices.WLDDG.label","images":["wilddog-1.jpg","wilddog-2.jpg","wilddog-3.jpg"],"confusions" => {"HN" => "A hyena is stockier than a wild dog with yellowish fur and light brown spots. Its back is sloped downward.","JCKL" => "A jackal is smaller than a wild dog with light brown and silver-black fur."},"description" => "Medium-sized, lanky doglike animal with patchy tan, black, and white fur. It has a long, black muzzle and big, round, mostly black ears.","noQuestions":false,"characteristics" => {"LK":["CTDG"],"TL":["BSH","LNG"],"BLD":["LNK","SMLL"],"CLR":["TNLLW","BRWN","WHT","BLCK"],"HRNS":[],"PTTRN":["SLD","SPTS"]},"confusionsOrder":["HN","JCKL"]},"WRTHG" => {"image":[],"label" => "T1.choices.WRTHG.label","images":["warthog-1.jpg","warthog-2.jpg","warthog-3.jpg"],"confusions" => {"BSHPG" => "A bushpig has thick reddish-silvery fur and smaller tusks than a warthog.","HPPPTMS" => "A hippopotamus is much larger than a warthog with a round body, face, and tiny pink ears."},"description" => "Squat, maned, slate-furred, and piglike with a long, thin, tufted tail. Males have curved tusks at the end of their broad snout, while females have shorter tusks. Both sexes have distinctive warts below their eyes.","noQuestions":false,"characteristics" => {"LK":["THR"],"TL":["TFTD"],"BLD":["STCK","SMLL","LWSLNG"],"CLR":["BRWN","GR","BLCK"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":["BSHPG","HPPPTMS"]},"BRDTHR" => {"image":[],"label" => "T1.choices.BRDTHR.label","images":["birdother-1.jpg","birdother-2.jpg","birdother-3.jpg"],"confusions" => {},"description" => "There are about 400 bird species in Gorongosa, from small songbirds to large geese and ducks. If you find a bird that is not on the list, mark it here!","noQuestions":false,"characteristics" => {"LK":["BRD"],"TL":["SMTH","LNG","SHRT"],"BLD":["SMLL"],"CLR":["TNLLW","RD","BRWN","WHT","GR","BLCK"],"HRNS":[],"PTTRN":["SLD","STRPS","BNDS","SPTS"]},"confusionsOrder":[]},"BSHBCK" => {"image":[],"label" => "T1.choices.BSHBCK.label","images":["bushbuck-1.jpg","bushbuck-2.jpg","bushbuck-3.jpg"],"confusions" => {"NL" => "A nyala female has prominent vertical white stripes and white markings between the eyes, while a bushbuck female has lighter stripes and more prominent spots.","RDBCK" => "A reedbuck has solid tan fur without white spots or stripes. Its horns are ringed and it has a large, black spot below the ears."},"description" => "Medium-sized antelope with tan to chestnut brown fur with thin white stripes and spots on their flanks. Males are shaggy with darker fur and thick, spiral horns. Females are light tan and slender and have no horns.","noQuestions":false,"characteristics" => {"LK":["NTLPDR"],"TL":["BSH","SHRT"],"BLD":["LNK","LRG"],"CLR":["TNLLW","RD","BRWN","WHT"],"HRNS":["STRGHT","CRVD"],"PTTRN":["STRPS","SPTS"]},"confusionsOrder":["RDBCK","NL"]},"HNBDGR" => {"image":[],"label" => "T1.choices.HNBDGR.label","images":["honeybadger-1.jpg","honeybadger-2.jpg","honeybadger-3.jpg"],"confusions" => {},"description" => "Small, stocky mammal with short legs and a wide body. The lower half of the body is covered in black fur, and the head, back, and the top of the tail are covered in solid white-gray fur.","noQuestions":false,"characteristics" => {"LK":["CTDG","WSL"],"TL":["BSH"],"BLD":["STCK","SMLL","LWSLNG"],"CLR":["WHT","GR","BLCK"],"HRNS":[],"PTTRN":["SLD","BNDS"]},"confusionsOrder":[]},"HRTBST" => {"image":[],"label" => "T1.choices.HRTBST.label","images":["hartebeest-1.jpg","hartebeest-2.jpg","hartebeest-3.jpg"],"confusions" => {"KD" => "A kudu is stockier than a hartebeest with tan-gray fur, vertical stripes, and the males have manes and massive spiral horns.","LND" => "An eland is more stocky and ox-like than a hartebeest with long, straight horns that twist. It has a dewlap below the neck.","WLDBST" => "A wildebeest is dark gray-brown with a mane and beard. Its horns are longer than a hartebeest."},"description" => "Large, reddish-yellow antelope with an elongated, horselike face, large, pointy ears, humped shoulders, sloped back, and a light underbelly and hind parts with a short, tufted tail. Both sexes have curved, ridged horns.","noQuestions":false,"characteristics" => {"LK":["CWHRS","NTLPDR"],"TL":["TFTD","LNG"],"BLD":["STCK","LNK","LRG"],"CLR":["TNLLW","RD","BRWN"],"HRNS":["CRVD","SPRL"],"PTTRN":["SLD"]},"confusionsOrder":["LND","WLDBST","KD"]},"WLDBST" => {"image":[],"label" => "T1.choices.WLDBST.label","images":["wildebeest-1.jpg","wildebeest-2.jpg","wildebeest-3.jpg"],"confusions" => {"BFFL" => "A buffalo is stockier and more cattlelike than a wildebeest and lacks a beard and mane.","HRTBST" => "A hartebeest has reddish-brown fur, very short horns, and lacks a beard and mane."},"description" => "Large, muscular antelope with a dark muzzle with a mane of hair along the throat and spine, broad shoulders, blue-gray to brown fur with subtle stripes, and a long, tufted tail. Both sexes have large, U-shaped horns.","noQuestions":false,"characteristics" => {"LK":["CWHRS","NTLPDR"],"TL":["TFTD","LNG"],"BLD":["STCK","LNK","LRG"],"CLR":["RD","BRWN","GR","BLCK"],"HRNS":["CRVD","SHPD"],"PTTRN":["SLD"]},"confusionsOrder":["BFFL","HRTBST"]},"WTRBCK" => {"image":[],"label" => "T1.choices.WTRBCK.label","images":["waterbuck-1.jpg","waterbuck-2.jpg","waterbuck-3.jpg"],"confusions" => {},"description" => "Large antelope with a wide, strong build, brownish-gray fur, a long neck with a shaggy mane, white fur under the neck and on the muzzle, and a white ring around the rump. Males have ringed horns that curve forward, while females have no horns.","noQuestions":false,"characteristics" => {"LK":["CWHRS","NTLPDR"],"TL":["TFTD","LNG"],"BLD":["STCK","LRG"],"CLR":["BRWN","GR"],"HRNS":["STRGHT","CRVD"],"PTTRN":["SLD"]},"confusionsOrder":[]},"HPPPTMS" => {"image":[],"label" => "T1.choices.HPPPTMS.label","images":["hippo-1.jpg","hippo-2.jpg","hippo-3.jpg"],"confusions" => {"WRTHG" => "A warthog is much smaller than a hippopotamus with horns and prominent warts on the face."},"description" => "Massive and low to the ground with short legs, small ears, gray to pink skin, a wide muzzle, and a short tail with a bristly tassel.","noQuestions":false,"characteristics" => {"LK":["CWHRS","THR"],"TL":["SMTH","SHRT"],"BLD":["STCK","LRG","LWSLNG"],"CLR":["RD","BRWN","GR"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":["WRTHG"]},"NTHNGHR" => {"image":[],"label" => "T1.choices.NTHNGHR.label","images":["nothing-1.jpg","nothing-2.jpg","nothing-3.jpg"],"confusions" => {},"description" => "It happens. Sometimes a shadow or moving blade of grass can make \"nothing here\" look like an animal.","noQuestions" => true,"characteristics" => {"LK":[],"TL":[],"BLD":[],"CLR":[],"HRNS":[],"PTTRN":[]},"confusionsOrder":[]},"RPTRTHR" => {"image":[],"label" => "T1.choices.RPTRTHR.label","images":["raptor-1.jpg","raptor-2.jpg","raptor-3.jpg"],"confusions" => {},"description" => "Raptors are predatory birds with large wingspans, sharp, hooked beaks, and huge talons. In addition to vultures, Gorongosa has over 30 species of raptors, including eagles, hawks, kites, falcons, and buzzards.","noQuestions":false,"characteristics" => {"LK":["BRD"],"TL":["SMTH","LNG","SHRT"],"BLD":["SMLL"],"CLR":["TNLLW","RD","BRWN","WHT","GR","BLCK"],"HRNS":[],"PTTRN":["SLD","STRPS","BNDS","SPTS"]},"confusionsOrder":[]},"SBLNTLP" => {"image":[],"label" => "T1.choices.SBLNTLP.label","images":["sable-1.jpg","sable-2.jpg","sable-3.jpg"],"confusions" => {},"description" => "Full-bodied, horselike antelope with a thick neck, mane, long, tufted tail, chestnut brown to black fur with white underbelly and chin, and white under the eyes with a black stripe down the nose. Both sexes have large, ringed horns that curve backward.","noQuestions":false,"characteristics" => {"LK":["CWHRS","NTLPDR"],"TL":["TFTD","LNG"],"BLD":["STCK","LRG"],"CLR":["RD","BRWN","WHT","BLCK"],"HRNS":["CRVD"],"PTTRN":["SLD"]},"confusionsOrder":[]},"SMNGMNK" => {"image":[],"label" => "T1.choices.SMNGMNK.label","images":["samangomonkey-1.jpg","samangomonkey-2.jpg"],"confusions" => {"BBN" => "A baboon has yellow-brown fur and a light colored face.","VRVTMNK" => "A vervet monkey is much smaller than a samango monkey with a black face and light gray fur."},"description" => "Medium-sized monkey with long, gray, speckled fur. Its face is dark gray, while its arms and legs fade to black toward the hands and feet. It has brown eyes, a white throat and underbelly, and a long, black tail.","noQuestions":false,"characteristics" => {"LK":["PRMT","THR"],"TL":["SMTH","LNG"],"BLD":["LNK","SMLL"],"CLR":["BRWN","WHT","GR","BLCK"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":["BBN","VRVTMNK"]},"VRVTMNK" => {"image":[],"label" => "T1.choices.VRVTMNK.label","images":["vervetmonkey-1.jpg","vervetmonkey-2.jpg","vervetmonkey-3.jpg"],"confusions" => {"BBN" => "A baboon is larger than a vervet monkey with yellow-brown fur and a light colored face.","SMNGMNK" => "A samango monkey is larger than a vervet monkey with bluish-gray fur and prominent fur on the cheeks."},"description" => "Small, gray-furred monkey whose face is black and ringed in white fur. Its hands, feet, and ears are also black, and it has a very long, black-tipped tail.","noQuestions":false,"characteristics" => {"LK":["PRMT","THR"],"TL":["SMTH","LNG"],"BLD":["LNK","SMLL"],"CLR":["BRWN","GR","BLCK"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":["BBN","SMNGMNK"]},"SCRTRBRD" => {"image":[],"label" => "T1.choices.SCRTRBRD.label","images":["secretarybird-1.jpg","secretarybird-2.jpg","secretarybird-3.jpg"],"confusions" => {},"description" => "Large, tall bird with gray feathers on the body and black feathers on the tips of the wings and legs. Its legs are extremely long, and its face is red-orange with a white beak. It has black feathers protruding from the back of its head like a fan.","noQuestions":false,"characteristics" => {"LK":["BRD"],"TL":["SMTH","LNG"],"BLD":["LNK","LRG"],"CLR":["WHT","GR","BLCK"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":[]},"GRNDHRNBLL" => {"image":[],"label" => "T1.choices.GRNDHRNBLL.label","images":["groundhornbill-1.jpg","groundhornbill-2.jpg","groundhornbill-3.jpg"],"confusions" => {},"description" => "Large, stocky black bird with a red face, long, black beak, and red flaps of skin on its throat.","noQuestions":false,"characteristics" => {"LK":["BRD"],"TL":["SMTH"],"BLD":["STCK","SMLL"],"CLR":["RD","WHT","BLCK"],"HRNS":[],"PTTRN":["SLD"]},"confusionsOrder":[]}},"questions" => {"HWMN" =>